    useEffect(()=>{
        fetch("http://localhost:8080/yourorder?pid="+pid)
            .then(res => res.json())
            .then(userorder => setOrder(userorder))
            .then(console.log(order))
    },[])

    return(
        <>
        <Bar/>
        <div className="container mt-5">
            <div className="row text-left">
                <h3>Your Orders</h3>
                <div className="col-6">
                    <table>
                        <tr>

                        </tr>
                    </table>
                </div>

            </div>

        </div>
        
        </>
    )
}
